import React from "react";
import {
  Menu,
  MenuButton,
  MenuList,
  MenuItem,
  useColorMode,
  Image,
  Text,
  Icon,
} from "@chakra-ui/core";

const ProjectSettings = () => {
  const { colorMode } = useColorMode();
  return (
    <Menu>
      <MenuButton
        display="flex"
        alignItems="center"
        backgroundColor={`mode.${colorMode}.background`}
      >
        <Image
          src="https://media.graphcms.com/GFjpdH7nTwSWUMaHn6HY"
          size={10}
          roundedLeft="sm"
          borderColor={`mode.${colorMode}.background`}
        />
        <Text ml={2} mr={8} color={`mode.${colorMode}.text`}>
          Web app
        </Text>
        <Icon name="chevron-down" mr={2} color={`mode.${colorMode}.text`} />
      </MenuButton>
      <MenuList zIndex={0}>
        <MenuItem color={`mode.${colorMode}.text`}>Download</MenuItem>
        <MenuItem color={`mode.${colorMode}.text`}>Create a Copy</MenuItem>
        <MenuItem color={`mode.${colorMode}.text`}>Mark as Draft</MenuItem>
        <MenuItem color={`mode.${colorMode}.text`}>Delete</MenuItem>
        <MenuItem color={`mode.${colorMode}.text`}>Attend a Workshop</MenuItem>
      </MenuList>
    </Menu>
  );
};

export default ProjectSettings;
